&lt;div&gt;
	Planetary entry and near-Earth object return missions with an anticipated heat flux between 1,500 and 10,000 W/cm&lt;sup&gt;2&lt;/sup&gt; are currently limited to one viable TPS material - fully dense carbon phenolic (CP). However, high-density CP is only mass efficient at heat fluxes above 4000 W/cm&lt;sup&gt;2&lt;/sup&gt;. This mid-density TPS performance gap can be filled using cost-effective weaving technology to produce high-grade, conformal, mid- to high-density TPS. Woven TPS not only bridges this gap but also offers a superior performing replacement for heritage CP.&lt;/div&gt;
&lt;div&gt;
	&amp;nbsp;&lt;/div&gt;
&lt;div&gt;
	A woven TPS approach can result in TPS solutions that are optimized to a given mission&amp;#39;s environments but with much-reduced costs compared to current TPS development and certification approaches. The woven TPS approach utilizes a stable U.S. weaving industrial base and processes that has a proven legacy and longevity in manufacturing commercial and advanced aerospace products. This industry has demonstrated capability to weave highly complex patterns in a 3D weave configuration for commercial applications.&lt;/div&gt;
&lt;div&gt;
	&amp;nbsp;&lt;/div&gt;
&lt;div&gt;
	The Woven TPS Project will demonstrate this concept in partnership with a reliable industrial weaver selected through a Request for Information process in a 14-month program. We will accomplish this by designing and manufacturing a series of low-, mid- and high-density samples of woven carbon fiber material of varying yarn compositions, weave architectures, and level of resin infiltration and by testing them at extreme conditions. It is the project&amp;#39;s goal to develop a preliminary database, compare the performance of woven TPS against heritage fully dense CP, and raise the woven TPS from Technology Readiness Level (TRL) 2 at the start of the project to TRL 3 at project completion.&lt;/div&gt;
